import React from 'react'
import MyNavbar from '../components/MyNavbar';
import graph from '../images/graph.png';


export default function Dashboard() {
  return (
    <div>
        <MyNavbar/>
        <br/>
        <br/>
        <img src={graph} alt="graph" style={{marginLeft:"260px", marginTop:"30px"}}/>

    </div>
  )
}
